import React, { useState, useEffect } from 'react';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import CardActions from '@material-ui/core/CardActions';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import Collapse from '@material-ui/core/Collapse';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import Icon from '@mdi/react';
import { mdiThumbUp, mdiThumbUpOutline, mdiChevronDown, mdiChevronUp, mdiDelete, mdiUsers, mdiAccountGroupOutline as GroupOutline } from '@mdi/js';
import { makeStyles } from '@material-ui/core/styles';
import axios from 'axios';
import * as _ from 'underscore';
import { connect } from 'react-redux';
import swal from 'sweetalert';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import { useHistory } from 'react-router-dom';

const useStyles = makeStyles(() => ({
    card: {
        madWidth: 600,
        margin: 'auto',
    },
    media: {
        height: 0,
        padding: '56.25%',
    },
    image: {
        maxWidth: '100%',
        maxHeight: '100%',
    },
}));

function EventComponent(props) {
    const classes = useStyles();
    const history = useHistory();
    const [collapse, setCollapse] = useState(false);

    useEffect(() => {
        //First, if the user is logged in, update the state primary color. 
        if(props.user !== null) {
            props.dispatch({type: 'ThemeChange', payload: props.user.profileTheme});
        }
    }, []);

    return (
        <Card 
            className={classes.card} 
            id={`${props.event.uniqueEventId}`}
            variant='outlined'
            style={{
                marginBottom: 20,
            }}
        >
            <CardHeader 
                title={
                    <Typography 
                        variant='h6' 
                        component='h6' 
                    >
                        {props.event.username}
                    </Typography>
                }
                avatar={
                    <Avatar 
                        src={`http://192.168.0.17:3001/api/get/avatar/by/id/${props.event.uniqueUserId}`}
                        alt={`${props.event.username}`}
                        title={`${props.event.username}`} 
                    />
                }
            />
             <div>
                {true &&
                    <CardMedia 
                        component='img'
                        src={`http://192.168.0.17:3001/api/get-photo/${props.event.src}`}
                        title={`Post by ${props.event.username}`}
                        alt='GeoCities'
                    />
                }
            </div>
            <CardContent>
                <Typography 
                    variant='h6' 
                    component='h6' 
                    align='left' 
                >
                    {props.event.title} 
                </Typography>
                <br />
                <Typography 
                    variant='subtitle1' 
                    component='span' 
                    align='left'
                >
                    When: {props.event.dateString} at {props.event.timeString}
                </Typography>
                <br />
                <Typography 
                    variant='body1' 
                    component='p' 
                    align='left' 
                    style={{
                        marginTop: 30,
                    }}
                >
                    {props.event.description} 
                </Typography>
            </CardContent>
            {props.user !== null &&
                <CardActions>
                    <IconButton  
                        color='primary'
                    >

                        <Icon
                            path={_.find(props.event.likes, like => like.uniuqueUserId === props.user.uniqueUserId) ? mdiThumbUp : mdiThumbUpOutline}
                            size={2} 
                            title='Like the event post!'
                        />
                    </IconButton>
                    <IconButton 
                        color='primary' 
                    >
                        <Icon 
                            path={GroupOutline} 
                            size={2}
                            title='How many attending' 
                        />
                        {props.event.attending.length} attending 
                    </IconButton>
                    <Button 
                        color='primary' 
                    >
                        {props.user.uniqueUserId !== props.event.uniqueUserId &&
                            <div>
                                {_.find(props.event.attending, attender => attender.uniqueUserId === props.user.uniqueUserId) ? 'unattend' : 'attend'}
                            </div>
                        }
                    </Button>
                    {props.user.uniqueUserId === props.event.uniqueUserId &&
                        <IconButton 
                            color='primary' 
                        >
                            <Icon 
                                path={mdiDelete} 
                                size={2} 
                                title='Delete event' 
                            />
                        </IconButton>
                    }
                </CardActions>
            }
        </Card>
    );
}

function mapStateToProps(state) {
    return {
        user: state.userReducer.user,
        primary: state.themeReducer.theme,
    };
}

export default connect(mapStateToProps)(EventComponent);
